// Helper function to get sprite coordinates by tag
export function getSpriteCoordinate(spriteTag: string) {
  return SPRITE_DEFINITIONS[spriteTag] || null;
}

// Helper function to check if a sprite exists
export function hasSprite(spriteTag: string): boolean {
  return spriteTag in SPRITE_DEFINITIONS;
}

// Helper function to get all sprite tags matching a pattern
export function getMatchingSprites(pattern: string): string[] {
  return Object.keys(SPRITE_DEFINITIONS).filter(tag => tag.includes(pattern));
}

// Helper function to get sprite sheet URL for a given sheet index
export function getSpriteSheetUrl(sheetIndex: number): string {
  return `/tilesets/freeciv-web-tileset-amplio2-${sheetIndex}.png`;
}